import React, { Component } from 'react';
import ImageContent from './ImageContent';

class Page404Container extends Component {
  render() {
    return (
      <Flex flexDirection="column" alignItems="stretch" width={'100%'}>
        <Flex flex={1} alignItems="center" flexDirection="column">
          <Flex
            flex={1}
            py={20}
            px={50}
            className="pagenotfound-content shadow"
            style={{ borderRadius: 5 }}
            backgroundColor="white"
            flexDirection="column"
          >
            <Box as="text" pb={20} color="primary">
              ATALINK là Giải pháp Quản trị chuỗi cung ứng trên nền tảng công
              nghệ điện toán đám mây (Cloud-based Solution-as-a-Service), giúp
              mỗi Doanh nghiệp cũng như các ngành nghề trong nền kinh tế Việt
              Nam truy cập được, có cơ hội thấu hiểu nhiều bức tranh đa chiều
              khác nhau về chuỗi cung ứng liên quan mật thiết đến hiệu quả hoạt
              động sản xuất kinh doanh của mình.
            </Box>
            <Box
              as="text"
              style={{ textTransform: 'uppercase' }}
              fontWeight={700}
              fontSize={{ xs: 13, md: 20 }}
              color="primary"
            >
              Các tính năng chính của giải pháp
            </Box>

          </Flex>
        </Flex>
      </Flex>
    );
  }
}

export default Page404Container;
